import React from 'react'
import styled from 'styled-components'
import SendIcon from '@material-ui/icons/Send';

function ChatInput() {
    return (
        <Container>
            Chat Input
        </Container>
    )
}

export default ChatInput

const Container = styled.div`
    background: orange;
`;
